/* NOTIFY */
.notify-navbar {
    position: absolute;
    top: 130%;
    width: 404px;
    border: 1px solid #d3d3d3;
    background-color: #FFFFFF;
    right: 0;
    transform-origin: calc(100% - 20px) top;
    animation: notifyNavbar ease-in 0.3s;
    display: none;
}

.notify-navbar::before {
    content: "";
    border-width: 10px 20px;
    border-style: solid;
    border-color: transparent transparent white transparent;
    position: absolute;
    top: -16px;
    right: 22px;

}

/* ANIMATION-navbar */
@keyframes notifyNavbar {
    from {
        opacity: 0;
        transform: scale(0);
    }

    to {
        opacity: 1;
        transform: scale(1);
    }
}

/* show  notify */
.navbar-item--showNotifybox:hover .notify-navbar {
    display: block;
}

